import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./components/App";
import HomePage from "./pages/HomePage";
import BrandPage from "./pages/BrandPage";
// import BrandListPage from './pages/BrandListPage';
import FoundationsPage from "./pages/Foundations/FoundationsPage";
import FoundationsColor from "./pages/Foundations/FoundationsColor";
import FoundationsTyporgaphy from "./pages/FoundationsTyporgaphy";
import FoundationsIcon from "./pages/FoundationsIcon";
import FoundationsGrid from "./pages/FoundationsGrid";
import FoundationsRadius from "./pages/FoundationsRadius";
import FoundationsShadow from "./pages/FoundationsShadow";
import FoundationsBorder from "./pages/FoundationsBorder";

import ComponentsPage from "./pages/ComponentsPage";
import ContentsPage from "./pages/ContentsPage";
import ResourcesPage from "./pages/ResourcesPage";
import WishlistPage from "./pages/WishlistPage";
import ScrollTop from "./components/ScrollTop";
import SamplePage from "./pages/SamplePage";

function Main() {
  return (
    <BrowserRouter basename={process.env.PUBLIC_URL}>
      <ScrollTop />
      <App>
        <Routes>
          <Route path="/" element={<HomePage />} />
          {/* <Route path="brand" element={<BrandListPage />}/> */}
          <Route path="brand" element={<BrandPage />} />
          <Route path="foundations" element={<FoundationsPage />} />
          <Route path="foundations/color" element={<FoundationsColor />} />
          <Route path="foundations/typorgaphy" element={<FoundationsTyporgaphy />} />
          <Route path="foundations/icon" element={<FoundationsIcon />} />
          <Route path="foundations/grid" element={<FoundationsGrid />} />
          <Route path="foundations/radius" element={<FoundationsRadius />} />
          <Route path="foundations/shadow" element={<FoundationsShadow />} />
          <Route path="foundations/border" element={<FoundationsBorder />} />
          <Route path="components" element={<ComponentsPage />} />
          <Route path="contents" element={<ContentsPage />} />
          <Route path="resources" element={<ResourcesPage />} />
          <Route path="sample" element={<SamplePage />} />
          <Route path="wishlist" element={<WishlistPage />} />
        </Routes>
      </App>
    </BrowserRouter>
  );
}

export default Main;
